import React from "react";
import Header from "./header";
import Footer from "./footer";
import Note from "./note";
import Notes from "note";

function createCard(note){
    return <Note 
    key = {note.key}
    title = {note.title}
    content = {note.content}
  />
}

function App(){
    return <div>
        <Header />
        <Note />
        <Footer />
    </div>
}

export default App;
